import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import './footer.css';

var Footer = () => {
    return (
        <div class="footer">
            <p class="f-container">
                COPYRIGHT &copy; SEAN LIN 2020
            </p>
        </div>
    )
}

export default Footer;
